import styled from "../"


const Form = () => {
  return (
    <div style={{ color: "green" }}>
      <form className={style.formP}>
        <label htmlFor="">Gmail:</label>
        <input type="email" />

        <label htmlFor="">Username:</label>
        <input type="text"/>

        <label htmlFor="">Password:</label>
        <input type='Text'/>

        <button type="button">Login</button>
      </form>
    </div>
  );
};

export default Form;
